let make_ftrace_config 
  ?(ftrace_events=[])
  ?(atrace_categories=[])
  ?(atrace_apps=[])
  ?(atrace_categories_prefer_sdk=[])
  ?(atrace_userspace_only:bool option)
  ?(buffer_size_kb:int32 option)
  ?(buffer_size_lower_bound:bool option)
  ?(drain_period_ms:int32 option)
  ?(drain_buffer_percent:int32 option)
  ?(compact_sched:ftrace_config_compact_sched_config option)
  ?(print_filter:ftrace_config_print_filter option)
  ?(symbolize_ksyms:bool option)
  ?(ksyms_mem_policy:ftrace_config_ksyms_mem_policy option)
  ?(throttle_rss_stat:bool option)
  ?(denser_generic_event_encoding:bool option)
  ?(disable_generic_events:bool option)
  ?(syscall_events=[])
  ?(enable_function_graph:bool option)
  ?(function_filters=[])
  ?(function_graph_roots=[])
