  ?(instance_name:string option)
  ?(debug_ftrace_abi:bool option)
  ?(tids_to_trace=[])
  ?(tracefs_options=[])
  ?(tracing_cpumask:string option)
  ?(initialize_ksyms_synchronously_for_testing:bool option)
  () : ftrace_config  =
  let _res = default_ftrace_config () in
  ftrace_config_set_ftrace_events _res ftrace_events;
  ftrace_config_set_atrace_categories _res atrace_categories;
  ftrace_config_set_atrace_apps _res atrace_apps;
  ftrace_config_set_atrace_categories_prefer_sdk _res atrace_categories_prefer_sdk;
  (match atrace_userspace_only with
  | None -> ()
  | Some v -> ftrace_config_set_atrace_userspace_only _res v);
  (match buffer_size_kb with
  | None -> ()
  | Some v -> ftrace_config_set_buffer_size_kb _res v);
  (match buffer_size_lower_bound with
  | None -> ()
  | Some v -> ftrace_config_set_buffer_size_lower_bound _res v);
  (match drain_period_ms with
  | None -> ()
  | Some v -> ftrace_config_set_drain_period_ms _res v);
  (match drain_buffer_percent with
  | None -> ()
  | Some v -> ftrace_config_set_drain_buffer_percent _res v);
  (match compact_sched with
  | None -> ()
  | Some v -> ftrace_config_set_compact_sched _res v);
  (match print_filter with
  | None -> ()
  | Some v -> ftrace_config_set_print_filter _res v);
  (match symbolize_ksyms with
  | None -> ()
  | Some v -> ftrace_config_set_symbolize_ksyms _res v);
  (match ksyms_mem_policy with
  | None -> ()
  | Some v -> ftrace_config_set_ksyms_mem_policy _res v);
  (match throttle_rss_stat with
  | None -> ()
  | Some v -> ftrace_config_set_throttle_rss_stat _res v);
  (match denser_generic_event_encoding with
  | None -> ()
  | Some v -> ftrace_config_set_denser_generic_event_encoding _res v);
  (match disable_generic_events with
  | None -> ()
  | Some v -> ftrace_config_set_disable_generic_events _res v);
  ftrace_config_set_syscall_events _res syscall_events;
  (match enable_function_graph with
  | None -> ()
  | Some v -> ftrace_config_set_enable_function_graph _res v);
  ftrace_config_set_function_filters _res function_filters;
  ftrace_config_set_function_graph_roots _res function_graph_roots;
  (match function_graph_max_depth with
  | None -> ()
  | Some v -> ftrace_config_set_function_graph_max_depth _res v);
  ftrace_config_set_kprobe_events _res kprobe_events;
  (match preserve_ftrace_buffer with
  | None -> ()
  | Some v -> ftrace_config_set_preserve_ftrace_buffer _res v);
  (match use_monotonic_raw_clock with
  | None -> ()
  | Some v -> ftrace_config_set_use_monotonic_raw_clock _res v);
  (match instance_name with
  | None -> ()
  | Some v -> ftrace_config_set_instance_name _res v);
  (match debug_ftrace_abi with
  | None -> ()
  | Some v -> ftrace_config_set_debug_ftrace_abi _res v);
  ftrace_config_set_tids_to_trace _res tids_to_trace;
  ftrace_config_set_tracefs_options _res tracefs_options;
  (match tracing_cpumask with
  | None -> ()
  | Some v -> ftrace_config_set_tracing_cpumask _res v);
  (match initialize_ksyms_synchronously_for_testing with
  | None -> ()
  | Some v -> ftrace_config_set_initialize_ksyms_synchronously_for_testing _res v);
  _res

