let rec pp_statsd_pull_atom_config fmt (v:statsd_pull_atom_config) = 
  let pp_i fmt () =
    Pbrt.Pp.pp_record_field ~first:true "pull_atom_id" (Pbrt.Pp.pp_list pp_atom_id) fmt v.pull_atom_id;
    Pbrt.Pp.pp_record_field ~first:false "raw_pull_atom_id" (Pbrt.Pp.pp_list Pbrt.Pp.pp_int32) fmt v.raw_pull_atom_id;
    Pbrt.Pp.pp_record_field ~first:false "pull_frequency_ms" Pbrt.Pp.pp_int32 fmt v.pull_frequency_ms;
    if not (statsd_pull_atom_config_has_pull_frequency_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "packages" (Pbrt.Pp.pp_list Pbrt.Pp.pp_string) fmt v.packages;
  in
  Pbrt.Pp.pp_brk pp_i fmt ()

let rec pp_statsd_tracing_config fmt (v:statsd_tracing_config) = 
  let pp_i fmt () =
    Pbrt.Pp.pp_record_field ~first:true "push_atom_id" (Pbrt.Pp.pp_list pp_atom_id) fmt v.push_atom_id;
    Pbrt.Pp.pp_record_field ~first:false "raw_push_atom_id" (Pbrt.Pp.pp_list Pbrt.Pp.pp_int32) fmt v.raw_push_atom_id;
    Pbrt.Pp.pp_record_field ~first:false "pull_config" (Pbrt.Pp.pp_list pp_statsd_pull_atom_config) fmt v.pull_config;
  in
  Pbrt.Pp.pp_brk pp_i fmt ()

