let rec pp_sys_stats_config fmt (v:sys_stats_config) = 
  let pp_i fmt () =
    Pbrt.Pp.pp_record_field ~first:true "meminfo_period_ms" Pbrt.Pp.pp_int32 fmt v.meminfo_period_ms;
    if not (sys_stats_config_has_meminfo_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "meminfo_counters" (Pbrt.Pp.pp_list pp_meminfo_counters) fmt v.meminfo_counters;
    Pbrt.Pp.pp_record_field ~first:false "vmstat_period_ms" Pbrt.Pp.pp_int32 fmt v.vmstat_period_ms;
    if not (sys_stats_config_has_vmstat_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "vmstat_counters" (Pbrt.Pp.pp_list pp_vmstat_counters) fmt v.vmstat_counters;
    Pbrt.Pp.pp_record_field ~first:false "stat_period_ms" Pbrt.Pp.pp_int32 fmt v.stat_period_ms;
    if not (sys_stats_config_has_stat_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "stat_counters" (Pbrt.Pp.pp_list pp_sys_stats_config_stat_counters) fmt v.stat_counters;
    Pbrt.Pp.pp_record_field ~first:false "devfreq_period_ms" Pbrt.Pp.pp_int32 fmt v.devfreq_period_ms;
    if not (sys_stats_config_has_devfreq_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "cpufreq_period_ms" Pbrt.Pp.pp_int32 fmt v.cpufreq_period_ms;
    if not (sys_stats_config_has_cpufreq_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "buddyinfo_period_ms" Pbrt.Pp.pp_int32 fmt v.buddyinfo_period_ms;
    if not (sys_stats_config_has_buddyinfo_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "diskstat_period_ms" Pbrt.Pp.pp_int32 fmt v.diskstat_period_ms;
    if not (sys_stats_config_has_diskstat_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "psi_period_ms" Pbrt.Pp.pp_int32 fmt v.psi_period_ms;
    if not (sys_stats_config_has_psi_period_ms v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "thermal_period_ms" Pbrt.Pp.pp_int32 fmt v.thermal_period_ms;
    if not (sys_stats_config_has_thermal_period_ms v) then Format.pp_print_string fmt "(* absent *)";
