  | Trusted_packet_sequence_id x -> Format.fprintf fmt "@[<hv2>Trusted_packet_sequence_id(@,%a)@]" Pbrt.Pp.pp_int32 x

and pp_trace_packet fmt (v:trace_packet) = 
  let pp_i fmt () =
    Pbrt.Pp.pp_record_field ~first:true "timestamp" Pbrt.Pp.pp_int64 fmt v.timestamp;
    if not (trace_packet_has_timestamp v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "timestamp_clock_id" Pbrt.Pp.pp_int32 fmt v.timestamp_clock_id;
    if not (trace_packet_has_timestamp_clock_id v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "data" (Pbrt.Pp.pp_option pp_trace_packet_data) fmt v.data;
    Pbrt.Pp.pp_record_field ~first:false "optional_trusted_uid" (Pbrt.Pp.pp_option pp_trace_packet_optional_trusted_uid) fmt v.optional_trusted_uid;
    Pbrt.Pp.pp_record_field ~first:false "optional_trusted_packet_sequence_id" (Pbrt.Pp.pp_option pp_trace_packet_optional_trusted_packet_sequence_id) fmt v.optional_trusted_packet_sequence_id;
    Pbrt.Pp.pp_record_field ~first:false "trusted_pid" Pbrt.Pp.pp_int32 fmt v.trusted_pid;
    if not (trace_packet_has_trusted_pid v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "interned_data" (Pbrt.Pp.pp_option pp_interned_data) fmt v.interned_data;
    Pbrt.Pp.pp_record_field ~first:false "sequence_flags" Pbrt.Pp.pp_int32 fmt v.sequence_flags;
    if not (trace_packet_has_sequence_flags v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "incremental_state_cleared" Pbrt.Pp.pp_bool fmt v.incremental_state_cleared;
    if not (trace_packet_has_incremental_state_cleared v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "trace_packet_defaults" (Pbrt.Pp.pp_option pp_trace_packet_defaults) fmt v.trace_packet_defaults;
    Pbrt.Pp.pp_record_field ~first:false "previous_packet_dropped" Pbrt.Pp.pp_bool fmt v.previous_packet_dropped;
    if not (trace_packet_has_previous_packet_dropped v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "first_packet_on_sequence" Pbrt.Pp.pp_bool fmt v.first_packet_on_sequence;
    if not (trace_packet_has_first_packet_on_sequence v) then Format.pp_print_string fmt "(* absent *)";
    Pbrt.Pp.pp_record_field ~first:false "machine_id" Pbrt.Pp.pp_int32 fmt v.machine_id;
    if not (trace_packet_has_machine_id v) then Format.pp_print_string fmt "(* absent *)";
  in
  Pbrt.Pp.pp_brk pp_i fmt ()

let rec pp_trace fmt (v:trace) = 
  let pp_i fmt () =
    Pbrt.Pp.pp_record_field ~first:true "packet" (Pbrt.Pp.pp_list pp_trace_packet) fmt v.packet;
  in
  Pbrt.Pp.pp_brk pp_i fmt ()

