let rec encode_pb_statsd_pull_atom_config (v:statsd_pull_atom_config) encoder = 
  Pbrt.List_util.rev_iter_with (fun x encoder ->
    encode_pb_atom_id x encoder;
    Pbrt.Encoder.key 1 Pbrt.Varint encoder; 
  ) v.pull_atom_id encoder;
  Pbrt.List_util.rev_iter_with (fun x encoder ->
    Pbrt.Encoder.int32_as_varint x encoder;
    Pbrt.Encoder.key 2 Pbrt.Varint encoder; 
  ) v.raw_pull_atom_id encoder;
  if statsd_pull_atom_config_has_pull_frequency_ms v then (
    Pbrt.Encoder.int32_as_varint v.pull_frequency_ms encoder;
    Pbrt.Encoder.key 3 Pbrt.Varint encoder; 
  );
  Pbrt.List_util.rev_iter_with (fun x encoder ->
    Pbrt.Encoder.string x encoder;
    Pbrt.Encoder.key 4 Pbrt.Bytes encoder; 
  ) v.packages encoder;
  ()

let rec encode_pb_statsd_tracing_config (v:statsd_tracing_config) encoder = 
  Pbrt.List_util.rev_iter_with (fun x encoder ->
    encode_pb_atom_id x encoder;
    Pbrt.Encoder.key 1 Pbrt.Varint encoder; 
  ) v.push_atom_id encoder;
  Pbrt.List_util.rev_iter_with (fun x encoder ->
    Pbrt.Encoder.int32_as_varint x encoder;
    Pbrt.Encoder.key 2 Pbrt.Varint encoder; 
  ) v.raw_push_atom_id encoder;
  Pbrt.List_util.rev_iter_with (fun x encoder ->
    Pbrt.Encoder.nested encode_pb_statsd_pull_atom_config x encoder;
    Pbrt.Encoder.key 3 Pbrt.Bytes encoder; 
  ) v.pull_config encoder;
  ()

