and encode_pb_track_descriptor (v:track_descriptor) encoder = 
  if track_descriptor_has_uuid v then (
    Pbrt.Encoder.int64_as_varint v.uuid encoder;
    Pbrt.Encoder.key 1 Pbrt.Varint encoder; 
  );
  if track_descriptor_has_parent_uuid v then (
    Pbrt.Encoder.int64_as_varint v.parent_uuid encoder;
    Pbrt.Encoder.key 5 Pbrt.Varint encoder; 
  );
  begin match v.static_or_dynamic_name with
  | None -> ()
  | Some (Name x) ->
    Pbrt.Encoder.string x encoder;
    Pbrt.Encoder.key 2 Pbrt.Bytes encoder; 
  | Some (Static_name x) ->
    Pbrt.Encoder.string x encoder;
    Pbrt.Encoder.key 10 Pbrt.Bytes encoder; 
  | Some (Atrace_name x) ->
    Pbrt.Encoder.string x encoder;
    Pbrt.Encoder.key 13 Pbrt.Bytes encoder; 
  end;
  if track_descriptor_has_description v then (
    Pbrt.Encoder.string v.description encoder;
    Pbrt.Encoder.key 14 Pbrt.Bytes encoder; 
  );
  begin match v.process with
  | Some x -> 
    Pbrt.Encoder.nested encode_pb_process_descriptor x encoder;
    Pbrt.Encoder.key 3 Pbrt.Bytes encoder; 
  | None -> ();
  end;
  begin match v.chrome_process with
  | Some x -> 
    Pbrt.Encoder.nested encode_pb_chrome_process_descriptor x encoder;
    Pbrt.Encoder.key 6 Pbrt.Bytes encoder; 
  | None -> ();
  end;
  begin match v.thread with
  | Some x -> 
    Pbrt.Encoder.nested encode_pb_thread_descriptor x encoder;
    Pbrt.Encoder.key 4 Pbrt.Bytes encoder; 
  | None -> ();
  end;
  begin match v.chrome_thread with
  | Some x -> 
    Pbrt.Encoder.nested encode_pb_chrome_thread_descriptor x encoder;
    Pbrt.Encoder.key 7 Pbrt.Bytes encoder; 
  | None -> ();
  end;
  begin match v.counter with
  | Some x -> 
    Pbrt.Encoder.nested encode_pb_counter_descriptor x encoder;
    Pbrt.Encoder.key 8 Pbrt.Bytes encoder; 
  | None -> ();
  end;
  if track_descriptor_has_disallow_merging_with_system_tracks v then (
    Pbrt.Encoder.bool v.disallow_merging_with_system_tracks encoder;
    Pbrt.Encoder.key 9 Pbrt.Varint encoder; 
  );
  if track_descriptor_has_child_ordering v then (
    encode_pb_track_descriptor_child_tracks_ordering v.child_ordering encoder;
    Pbrt.Encoder.key 11 Pbrt.Varint encoder; 
  );
  if track_descriptor_has_sibling_order_rank v then (
    Pbrt.Encoder.int32_as_varint v.sibling_order_rank encoder;
    Pbrt.Encoder.key 12 Pbrt.Varint encoder; 
  );
  if track_descriptor_has_sibling_merge_behavior v then (
    encode_pb_track_descriptor_sibling_merge_behavior v.sibling_merge_behavior encoder;
    Pbrt.Encoder.key 15 Pbrt.Varint encoder; 
  );
  begin match v.sibling_merge_key_field with
  | None -> ()
  | Some (Sibling_merge_key x) ->
    Pbrt.Encoder.string x encoder;
    Pbrt.Encoder.key 16 Pbrt.Bytes encoder; 
  | Some (Sibling_merge_key_int x) ->
    Pbrt.Encoder.int64_as_varint x encoder;
    Pbrt.Encoder.key 17 Pbrt.Varint encoder; 
  end;
  ()

