    Pbrt.Encoder.int32_as_varint v.sequence_flags encoder;
    Pbrt.Encoder.key 13 Pbrt.Varint encoder; 
  );
  if trace_packet_has_incremental_state_cleared v then (
    Pbrt.Encoder.bool v.incremental_state_cleared encoder;
    Pbrt.Encoder.key 41 Pbrt.Varint encoder; 
  );
  begin match v.trace_packet_defaults with
  | Some x -> 
    Pbrt.Encoder.nested encode_pb_trace_packet_defaults x encoder;
    Pbrt.Encoder.key 59 Pbrt.Bytes encoder; 
  | None -> ();
  end;
  if trace_packet_has_previous_packet_dropped v then (
    Pbrt.Encoder.bool v.previous_packet_dropped encoder;
    Pbrt.Encoder.key 42 Pbrt.Varint encoder; 
  );
  if trace_packet_has_first_packet_on_sequence v then (
    Pbrt.Encoder.bool v.first_packet_on_sequence encoder;
    Pbrt.Encoder.key 87 Pbrt.Varint encoder; 
  );
  if trace_packet_has_machine_id v then (
    Pbrt.Encoder.int32_as_varint v.machine_id encoder;
    Pbrt.Encoder.key 98 Pbrt.Varint encoder; 
  );
  ()

let rec encode_pb_trace (v:trace) encoder = 
  Pbrt.List_util.rev_iter_with (fun x encoder ->
    Pbrt.Encoder.nested encode_pb_trace_packet x encoder;
    Pbrt.Encoder.key 1 Pbrt.Bytes encoder; 
  ) v.packet encoder;
  ()

